import React, { useRef, useEffect } from "react";
import { motion, useScroll, useTransform, useSpring, useInView } from "framer-motion";
import Header from "./Header";
import InteractiveLines from "./InteractiveLines-i";
import Footer from "./Footer";

const Infosafe: React.FC = () => {
  const { scrollY } = useScroll();
  const scrollX = useTransform(scrollY, [0, 400], [0, -200]);
  const scrollX2 = useTransform(scrollY, [400, 800], [200, 0]);
  const xSpring = useSpring(scrollX, { stiffness: 100, damping: 30 });
  const xSpring2 = useSpring(scrollX2, { stiffness: 100, damping: 30 });
  const heroRef = useRef(null);
  const secondSectionRef = useRef(null);
  const heroInView = useInView(heroRef, { once: true, amount: 0.3 });
  const secondSectionInView = useInView(secondSectionRef, { once: true, amount: 0.3 });

  useEffect(() => {
    console.log('Infosafe component mounted');
    console.log('Hero in view:', heroInView);
  }, [heroInView]);

  return (
    <div className="relative min-h-screen bg-[#F4F1EC]">
      <Header />
      <motion.section 
        ref={heroRef}
        className="relative w-full min-h-[100vh] h-screen overflow-hidden"
        initial={{ opacity: 0 }}
        animate={{ opacity: heroInView ? 1 : 0 }}
        transition={{ duration: 1 }}
      >
        <InteractiveLines />
        <div className="absolute inset-0 flex items-center justify-center">
          <motion.div
            className="relative z-20 translate-y-50"
            animate={{
              y: [0, -20, 0],
              scale: [1, 1.1, 1],
            }}
            transition={{
              duration: 4,
              repeat: Infinity,
              ease: "easeInOut",
            }}
          >
            <motion.img 
              src="/card2.png" 
              alt="Infosafe" 
              className="w-80 h-auto"
              whileHover={{
                scale: 1.1,
                transition: {
                  duration: 0.3,
                  ease: "easeOut"
                }
              }}
              onError={(e) => {
                console.error('Error loading image:', e);
                e.currentTarget.src = '/placeholder.png';
              }}
            />
          </motion.div>
        </div>
        <motion.h1
          className="relative z-10 text-[40vw] md:text-[35vw] lg:text-[30vw] font-serif font-bold text-right mt-[45vh] md:mt-[25vh] pr-[5vw] whitespace-nowrap"
          style={{ x: xSpring }}
        >
          INFOSAFE
        </motion.h1>
      </motion.section>

      <motion.section 
        ref={secondSectionRef}
        className="relative w-full min-h-[100vh] h-screen overflow-hidden bg-[#1A1A1A]"
        initial={{ opacity: 0 }}
        animate={{ opacity: secondSectionInView ? 1 : 0 }}
        transition={{ duration: 1 }}
      >
        <InteractiveLines />
        <div className="absolute inset-0 flex items-center justify-center">
          <motion.div
            className="relative z-20 translate-y-50"
            animate={{
              y: [0, -20, 0],
              scale: [1, 1.1, 1],
            }}
            transition={{
              duration: 4,
              repeat: Infinity,
              ease: "easeInOut",
            }}
          >
            <motion.img 
              src="/in4safe.png" 
              alt="IN4SAFE" 
              className="w-80 h-auto"
              whileHover={{
                scale: 1.1,
                transition: {
                  duration: 0.3,
                  ease: "easeOut"
                }
              }}
              onError={(e) => {
                console.error('Error loading image:', e);
                e.currentTarget.src = '/placeholder.png';
              }}
            />
          </motion.div>
        </div>
        <motion.h1
          className="relative z-10 text-[40vw] md:text-[35vw] lg:text-[30vw] font-serif font-bold text-left mt-[45vh] md:mt-[25vh] pl-[5vw] whitespace-nowrap text-[#FFD700]"
          style={{ x: xSpring2 }}
        >
          IN4SAFE
        </motion.h1>
      </motion.section>

      <main className="pt-24 px-8 pb-24">
        <div className="max-w-4xl mx-auto">
          <div className="prose prose-lg">
            <h2 className="text-2xl font-bold mb-4">Project Overview</h2>
            <p>Infosafe is a web application designed to help users manage and secure their personal information.</p>
            
            <div className="mt-8 grid grid-cols-1 md:grid-cols-2 gap-8">
              <div>
                <h3 className="text-xl font-semibold mb-4">Key Features</h3>
                <ul className="list-disc pl-6 space-y-2">
                  <li>Secure information storage</li>
                  <li>User-friendly interface</li>
                  <li>Real-time data synchronization</li>
                  <li>Advanced security measures</li>
                </ul>
              </div>
              <div>
                <h3 className="text-xl font-semibold mb-4">Technologies Used</h3>
                <ul className="list-disc pl-6 space-y-2">
                  <li>React.js</li>
                  <li>TypeScript</li>
                  <li>Tailwind CSS</li>
                  <li>Framer Motion</li>
                </ul>
              </div>
            </div>

            <div className="mt-12">
              <h3 className="text-xl font-semibold mb-4">Project Screenshots</h3>
              <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                <img src="/info-1.png" alt="Infosafe Screenshot 1" className="w-full h-auto rounded-lg" />
                <img src="/info-2.png" alt="Infosafe Screenshot 2" className="w-full h-auto rounded-lg" />
              </div>
            </div>
          </div>
        </div>
      </main>
      <Footer />
    </div>
  );
};

export default Infosafe;
